import React, { useState } from 'react';
import axios from 'axios';

const CreateUser = () => {
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: ''
  });

  const handleChange = event => {
    setFormData({
      ...formData,
      [event.target.name]: event.target.value
    });
  };

  const handleSubmit = async event => {
    event.preventDefault();
    try {
      const response = await axios.post('http://127.0.0.1:8000/users/', formData);
      console.log( formData);
      // Optionally, you can redirect the user to another page or show a success message
    } catch (error) {
      console.error('Error creating user:', error);
      // Optionally, you can show an error message to the user
    }
  };

  return (
    <div className='main_top'>
      <h1>Create User</h1>
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="username">Username:</label>
          <input
            type="text"
            id="username"
            name="username"
            value={formData.username}
            onChange={handleChange}
          />
        </div>
        <div>
          <label htmlFor="email">Email:</label>
          <input
            type="email"
            id="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
          />
        </div>
        <div>
          <label htmlFor="password">Password:</label>
          <input
            type="password"
            id="password"
            name="password"
            value={formData.password}
            onChange={handleChange}
          />
        </div>
        <div className='sarebutton'>
        <div ><button className='box_ grey' type="submit"><a href='/userlist'>All Users</a></button></div>
        <div ><button className='box_ grey' type="submit">Create User</button></div>
        <div ><button className='box_ grey' type="submit"><a href='/edituser'>Edit User</a></button></div>
        <div ><button className='box_ grey' type="submit"><a href='/deleteuser'>Delete User</a></button></div>
        </div>
      </form>
    </div>
  );
};

export default CreateUser;
